import React, { Component } from "react";
import {
  Button,
  ButtonGroup,
  InputGroup,
  InputGroupAddon,
  DropdownItem,
  DropdownMenu,
  Card,
  CardBody,
  CardHeader,
  Col,
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from "reactstrap";
// feature: save test settings in json file
class FormPage extends Component {
  constructor(props) {
    super(props);
  }

  handleBtnClick = (btnInfo) => {
    // const { btnGroupID, btnID } = btnInfo;
    // const counters = this.state.counters.filter((c) => c.id !== counterID);
    // this.state.numCounters--;
    // const numCounters = this.state.numCounters;
    // this.setState({ numCounters });
    // this.setState({ counters });
  };

  handleClick(e) {
    const inputs = document.querySelector(".layer-class > input");
    console.log(inputs);
  }

  render() {
    return (
      <React.Fragment>
        <Row>
          <Col xl={6} lg={12} md={12}>
            <Card id="NewTest">
              <CardHeader>New Test</CardHeader>
              <CardBody class="layer-class">
                Layer{"........"}
                <input
                  type="button"
                  value="DNS"
                  name="DNS"
                  onClick={this.handleClick}
                />
                <input
                  type="button"
                  value="TCP"
                  name="TCP"
                  onClick={this.handleClick}
                />
                <input
                  type="button"
                  value="UDP"
                  name="UDP"
                  onClick={this.handleClick}
                />
                {/* {<ButtonGroup id="LayerSelect">
                  <Button onClick={() => this.handleBtnClick({})}>
                    Routing
                  </Button>{" "}
                  <Button>Network</Button> <Button>DNS</Button>{" "}
                  <Button>DNS+</Button> <Button>Web</Button>{" "}
                  <Button>Voice</Button>
                </ButtonGroup>} */}
                <br />
                <br />
                {"Test Type "}
                <ButtonGroup className="mr-2">
                  <Button>Agent to Server</Button>
                  <Button>Agent to Agent</Button>
                </ButtonGroup>
                <br />
                <br />
                <Form>
                  <FormGroup>
                    <Label for="exampleText">Test Name</Label>
                    <Input type="textarea" name="text" placeholder="Optional" />
                  </FormGroup>
                  <FormGroup>
                    <Label for="exampleText">Text Description</Label>
                    <Input type="textarea" name="text" placeholder="Optional" />
                  </FormGroup>
                </Form>
              </CardBody>
            </Card>
          </Col>

          <Col xl={6} lg={12} md={12}>
            <Card id="ViewsEnabledForTest">
              <CardHeader>Views Enabled for This Test</CardHeader>
              <CardBody>Network</CardBody>
            </Card>
          </Col>
        </Row>

        <Row>
          <Col xl={6} lg={12} md={12}>
            <Card id="BasicConfig">
              <CardHeader>Basic Configuration</CardHeader>
              <CardBody>
                <InputGroup size="normal">
                  <InputGroupAddon addonType="prepend">Target</InputGroupAddon>
                  <Input placeholder="e.g. google.com or 192.168.0.1" />
                </InputGroup>
                <br />
                <InputGroup>
                  <InputGroupAddon addonType="prepend">
                    Protocol
                  </InputGroupAddon>
                  <Input>
                    <DropdownMenu>
                      <DropdownItem>UDP</DropdownItem>
                      <DropdownItem divider />
                      <DropdownItem>FTP</DropdownItem>
                    </DropdownMenu>
                  </Input>
                </InputGroup>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </React.Fragment>
    );
  }
}

export default FormPage;
